import React from "react";
import {BrowserRouter, Route, Switch} from 'react-router-dom'

function App() {
  return (
      <BrowserRouter>
        <div className="container">
          <Switch>
            <Route />
          </Switch>
        </div>
      </BrowserRouter>

  );
}

export default App;
